body {

/* =======================
   Conteneurs individuels
   ======================= */
.img-container {
  position: relative;
  display: flex;               /* Flexbox pour centrer l'image à l'intérieur */
  justify-content: center;     /* Centre horizontalement l'image */
  align-items: center;         /* Centre verticalement l'image */
  overflow: hidden;
  cursor: grab;
}

/* =======================
   Styles des images
   ======================= */
.img-container img {
  width: 99.5%;               
  height: 99.5%;             
  object-fit: cover;      /* L'image s'ajuste dans le conteneur sans être coupée */
  display: block;           /* Supprime l'espace blanc sous les images (inline par défaut) */
  border-radius: 3px;       /* Coins légèrement arrondis */
}

.zoom-bar {
  position: absolute;
  bottom: 30px;
  left: 50%;
  transform: translateX(-50%);
  display: none;
  width: 40%;        /* longueur relative au container */
  height: 3px;      /* hauteur fixe */
  background: rgba(255, 255, 255, 0.326); /* gris transparent */
  -webkit-appearance: none; /* retire le style natif du slider */
  appearance: none;
  border-radius: 10px;
  outline: none;
}

/* Thumb personnalisé */
.zoom-bar::-webkit-slider-thumb {
  -webkit-appearance: none;
  appearance: none;
  width: 20px;
  height: 10px;
  background: #ffffffba;
  border-radius: 30%;
  cursor: pointer;
  border: 1px solid #fffdfd00;
}

.zoom-bar::-moz-range-thumb {
  width: 20px;
  height: 10px;
  background: #ffffffba;
  border-radius: 30%;
  cursor: pointer;
  border: 1px solid #fffdfd00;
}

.img-container:hover .zoom-bar {
  display: block;
}

/* =======================
   Conteneurs landscape
   ======================= */
.img-container[data-orientation="landscape"] {
  width: calc(99.5vw / 3.2);       /* Largeur calculée selon la fenêtre (viewport) */
  height: calc((99.5vw / 3.2) * 2 / 3); /* Hauteur proportionnelle à la largeur */
}

/* =======================
   Conteneurs portrait
   ======================= */

.img-container[data-orientation="portrait"] {
  width: calc((99.5vw / 3.2) * 2 / 3); /* Largeur plus étroite pour portrait */
  height: calc(99.5vw / 3.2);          /* Hauteur plus grande pour portrait */
}
